import React from 'react'
import waitForElm from '../middlewares/waitForElm'
import Aeapi from '../api/aeapi'

const FormField = ()=>{
    return (
      <div className='formField'>
        <input type={'text'} id={'username'}></input>
        <input type={'text'} id={'password'}></input>
        <input type={'submit'} id={'loginBtn'}></input>
      </div>
    )
}

waitForElm('.formField').then(()=>{
  let username = document.getElementById('username')
  let password = document.getElementById('password')
  document.getElementsByClassName('click',function(){
    console.log('aabb')
    Aeapi.login(username,password)
  })
})

export default FormField;
